// import React from "./react";
import Logo from '../common/Logo/Logo';
import "./Header.css";

function Header() {
    return (
        <header>
            <div id="header-div">
                <Logo width="110"/>
                <a class="nav-elem">Популярные пользователи</a>
                <a class="nav-elem">Про нас</a>
                <a class="nav-elem">Популярные пользователи</a>
            </div>
        </header>
    )
}

export default Header;
